let mutFactor = 0.05

let newPopul = []

let step

let btnLoadPopul


function preload() {
  circuitimg = loadImage('circuito3.png');
}

function setup() {
  createCanvas(1500, 600);
  background(255)
  prev = createVector(0,0)
  let b = new border()
  b.createCircuit()
  b.createCheckPoints()

  let cars = initCars()
  popul = new population(cars)

  step = createP(popul.steps)

  btnSavePopul = createButton('Cargar NN entrenada en Smart Cars v2')
  btnSavePopul.mousePressed(loadNN)

  noLoop()
}

