function initCars(){
  let cars = []
  for(let i = 0; i < Ncars; i++){
    let c = new car(200 + map(i, 0, Ncars, 0, 50), 400)
    let n = new nn()
    n.init()
    c.update(0, 0)
    c.brain = n 
    cars.push(c)
  }
  return cars
}


